function Home(){
    return (
        <div class="container-fluid bg-light text-dark p-5">
        <div class="container bg-light p-5">
          <h1 class="display-4 fw-bold">Welcome to Admin Dashboard</h1>
          {/* <hr> */}
            <p>Go to My Website</p>
            <a href="#" class="btn btn-primary">link</a>
        </div>
      </div>
    );
}

export default Home;
